import React, { Component } from "react";
import App from "./App";

class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = "";
  }

  render() {
    return (
      <div className="MainDiv">
        <div>
          <label className="Label"> CALCULATOR </label>
        </div>
        <div>
          <input type="text" className="Input" value="" />
        </div>
        <div className="button">
          <button id="Sbtn">
            {" "}
            Clear{" "}
          </button>
          <button id="Sbtn"> Backspace </button> <br></br>
          <button id="btn" value="1">
            {" "}
            1
          </button>
          <button id="btn" value="2">
            {" "}
            2
          </button>
          <button id="btn" value="3">
            {" "}
            3
          </button>
          <button id="btn" value="+">
            {" "}
            +
          </button>{" "}
          <br></br>
          <button id="btn" value="4">
            {" "}
            4
          </button>
          <button id="btn" value="5">
            {" "}
            5
          </button>
          <button id="btn" value="6">
            {" "}
            6
          </button>
          <button id="btn" value="-">
            {" "}
            -
          </button>{" "}
          <br></br>
          <button id="btn" value="7">
            {" "}
            7
          </button>
          <button id="btn" value="8">
            {" "}
            8
          </button>
          <button id="btn" value="9">
            {" "}
            9
          </button>
          <button id="btn" value="*">
            {" "}
            *
          </button>{" "}
          <br></br>
          <button id="btn" value="=">
            {" "}
            =
          </button>
          <button id="btn" value="0">
            {" "}
            0
          </button>
          <button id="btn" value=".">
            {" "}
            .
          </button>
          <button id="btn" value="/">
            {" "}
            /
          </button>{" "}
          <br></br>
        </div>
      </div>
    );
  }
}

export default Button;
